  { url: '/video', text: 'ðŸ“º Videos' }
];

const Links = () => {
  return (
    <div className='flex items-center justify-between mt-4 sm:justified-around '>
      {links.map(({ url, text }, i) => (
        <NavLink
          key={i}
          to={url}
          activeClassName='text-blue-700 border-b-2 dark:text-blue-300 border-blue-700 pb-2'
        >
          {text}
        </NavLink>
      ))}
    </div>
  );
};

